Lana Del Rey Nominated for 2 MTV VMAÃ¢â‚¬â„¢s!

Written by: Aaron @ lanadelreyonline.com On: Jul 20, 2013 at 8:27 pm

&quot;Lana Del Rey unfortunately was not nominated for the main, however, received two nominations in technical categories: Ã¢â‚¬Å“RideÃ¢â‚¬ï¿½ video is nominated for Ã¢â‚¬Å“Best CinematographyÃ¢â‚¬ï¿½ and Ã¢â‚¬Å“National AnthemÃ¢â‚¬ï¿½ video is also nominated for Ã¢â‚¬Å“Best Art DirectionÃ¢â‚¬Å“. These categories are not open to popular vote and will be chosen by a panel! The winners will be announced on August 25 . The MTV VMAs 2013 take place for the first time in Brooklyn, New York at the Barclays Centre from 9pm.

My comment: Nicely deserved but still so robbed. Ride is Video of the Year! No wait, National Anthem is...too.

So for the second year in a row Lana received 2 VMA's noms, but again for only technical categories. When over this same time period she has literally changed the face of video.

Taylor Swift is nominated for the 2013 Video of the Year, for 'I Knew You Were Trouble.' That video is but a pale Lana imitation. Well, at least the girl's got good taste. And Taylor is acceptable to America. Lana since the &quot;SNL bomb scare&quot; is somehow still damaged goods in this country. We just don't get it. Like they do in Sister Europe.

Fuck, I got into Lana because of what had happened at SNL. I had not heard of her till then. I thought to myself, don't believe the anti-hype. She can't be that bad. I got to check her out. And for at least once in my life, I was right.

MTV has no balls anyway. That is why no one watches anymore. So WTFC. Lana has raw beautiful balls. I mean freak Kanye, who still cannot even sing.

Lana is the most dangerous, daring singer in the popular arena. And an mother-effin video genius. 

Lana Del Rey spells music magic vision.
